import logo from './logo.svg';
import './App.css';
import Navi from './components/Nav.js'
import Container from 'react-bootstrap/Container'
import firstpic from './pictures/bea.jpg';
import { ParallaxProvider } from 'react-scroll-parallax';

function App() {
  return (
    <div>
      <header className="App-header">
      <Navi/>
      </header>
      <div id="fullpage">
       <ParallaxProvider>
	      <div class="section">
          <div className="wrap">
            <div className="title">
              <h1>Weclome to our Wedding</h1>
              <p>Tying the knot November 2nd, 2019</p>
            </div>
          </div>
        </div>
       </ParallaxProvider>
	<div class="section-1">

  </div>
	<div class="section">Some section</div>
	<div class="section">Some section</div>
  </div>
  </div>
)
}

export default App;
